  let found = ptrs.find((ptr, i) => {
    let view = this.update([ptr])
    return cb(view, i)
  })
  return this.update([found])
}

const some = function (cb) {
  let ptrs = this.fullPointer
  return ptrs.some((ptr, i) => {
    let view = this.update([ptr])
    return cb(view, i)
  })
}

